import { Box, Stack, Spacer, Center, Flex, Button, Grid, Image, Text, GridItem, Menu, MenuButton, MenuList, MenuItem} from "@chakra-ui/react"

function DashboardRocket({singleRocket}) {
    const oneImage = singleRocket.flickr_images.map(i => {
        return(
            <Image
                borderRadius="full"
                boxSize="350px"
                src={singleRocket.flickr_images[0]}
                alt={singleRocket.name}
            />
        )
    })
    return(
        <Box>
            <Box w="100%" h="500px" bgGradient="linear(to-t, blue.900, blue.200)" >
                {singleRocket.name}
            </Box>
            <Box w="100%" h="500px" bgGradient="linear(to-t, blue.200, blue.900)" >
            <Stack direction="row">
                <Image
                    borderRadius="full"
                    boxSize="350px"
                    src={singleRocket.flickr_images[0]}
                    alt={singleRocket.name}
                />
            </Stack>
            </Box>
            <Box w="100%" h="500px" bgGradient="linear(to-t, blue.900, blue.200)" >

            </Box>
        </Box>
    )
}

export default DashboardRocket
